INSERT INTO `glb_accion_bitacora` VALUES (1, 'Inicio de sesión');
INSERT INTO `glb_accion_bitacora` VALUES (2, 'Cierre de sesión');
INSERT INTO `glb_accion_bitacora` VALUES (3, 'Inserción');
INSERT INTO `glb_accion_bitacora` VALUES (4, 'Modificación');
INSERT INTO `glb_accion_bitacora` VALUES (5, 'Eliminación');
INSERT INTO `glb_ayuda` VALUES (1, 72, 'En este pantalla se muestran los históricos de las solicitudes realizadas en donde podrá buscar algún registro mediante el campo buscar (parte superior derecha de la tabla) y presionando click en el ícono del PDF podrá visualizar un pdf generado listo para imprimir', 'Esta información es necesaria especialmente por cuestiones de auditoría y para mantener un histórico de las solicitudes');
INSERT INTO `glb_ayuda` VALUES (2, 80, 'Esta pantalla se encarga de la gestión de los presupuestos, en donde se pueden realizar las creaciones, modificaciones y refuerzos de un presupuesto', 'La información usada acá sirve para la generación de reportes e informes estadísticos que proporcionan un mejor panorama de la inversión realizada en el mantenimiento de los vehículos del mtps');
INSERT INTO `glb_ayuda` VALUES (3, 117, 'El objetivo de esta pantalla es proporcionar un control sobre el inventario de los materiales y artículos que se usan diariamente en el taller del mtps', 'Con esta información, se registra el movimiento de los materiales o artículos usados en el taller del mtps con lo cual posteriormente se genera un kardex');
INSERT INTO `glb_ayuda` VALUES (4, 70, 'A partir de esta pantalla se lleva a cabo el control de la salida y entrada de los vehículos, registrando los datos reales de salidas y entradas a la misión oficial', 'Con esta información se da cierre formal al proceso de la solicitud de transporte y tal información queda guardada como un histórico y puede ser usada con fines institucionales');
INSERT INTO `glb_ayuda` VALUES (5, 79, 'Desde aquí se muestra el catálogo completo de los vehículos del mtps; además, se puede ingresar un nuevo registro de vehículo o modificar la información de los ya existentes', 'La información de la flota vehicular es usada para tener un control más amplio sobre cada uno de los vehículos');
INSERT INTO `glb_ayuda` VALUES (6, 116, 'Esta pantalla es la encargada del control de los vehículos que se encuentran en el taller del mtps y desde aquí se registra desde el ingreso de un vehículo hasta que se le da de alta, con todos los mantenimientos que se le realicen durante su estancia en el taller', 'La información de esta pantalla es usada posteriormente para la generación de reportes e informes estadísticos que miden tanto el uso de los artículos en los mantenimientos, como el desempeño de los mecánicos');
INSERT INTO `glb_ayuda` VALUES (7, 118, 'Desde esta pantalla se registran los vehículos que se encuentran en un taller externo al mtps junto con la información del mantenimiento correctivo que realiza el taller al vehículo', 'Con esta información, se da mayor soporte y seguridad al control de los vehículos que se encuentran en un taller fuera del mtps');
INSERT INTO `glb_ayuda` VALUES (8, 143, 'A través de esta pantalla se pueden visualizar los mantenimientos que han sido realizados a los vehículos e incluso hasta de los vehículos que se encuentran en el taller del mtps', 'La hoja generada es guardada como un histórico puede imprimirse o usarse con fines de auditoría');
INSERT INTO `glb_ayuda` VALUES (9, 144, 'A través de esta pantalla se pueden visualizar la hoja de registro de ingreso y egreso de los vehículos en el taller interno', 'La hoja generada es guardada como un histórico puede imprimirse o usarse con fines de auditoría');
INSERT INTO `glb_ayuda` VALUES (10, 141, 'En esta pantalla se pueden generar reportes o informes estadísticos personalizados referentes a los artículos o materiales de bodega', 'Esta información prorporciona un mejor panorama de los artículos en bodega y también de su uso en los mantenimientos realizados a los vehículos en el taller interno o de manera rutinaria');
INSERT INTO `glb_ayuda` VALUES (11, 142, 'En esta pantalla se pueden generar reportes o informes estadísticos personalizados referentes al desempeño de los mecánicos en los mantenimientos realizados a los vehículos en el taller interno o de manera rutinaria', 'Con esta información es posible realizar una evaluación más real del desempeño de los mecánicos');
INSERT INTO `glb_ayuda` VALUES (12, 159, 'En esta pantalla se pueden generar reportes o informes estadísticos personalizados referentes al uso del presupuesto en relación al mantenimiento preventivo y correctivo de los vehículos del mtps', 'A través del conocimiento de estos resultados es posible realizar una toma de decisiones más acertada');
INSERT INTO `glb_ayuda` VALUES (13, 188, 'Esta es la pantalla de Control de Usuarios, en donde se pueden crear, modificar o eliminar usuarios', 'Con esta pantalla se definen los usuarios que tendrán acceso al sistema y los roles que poseerá proporcionando un mayor nivel de seguridad');
INSERT INTO `glb_ayuda` VALUES (14, 189, 'Esta pantalla es la encargada de administrar los roles; desde acá se puede crear, modificar o eliminar los roles según se desee', 'Es muy importante que los usuarios posean roles pues estos les dan permisos o restricciones sobre cada uno de los módulos del sistema dependiendo de lo que se desea permitir o restringir al usuario');
INSERT INTO `glb_ayuda` VALUES (15, 190, 'La pantalla bitácora proporciona un registro completo sobre cada una de las acciones que los diferentes usuarios realizan sobre los diferentes módulos del sistema', 'Esta información sirve para brindar una mayor cobertura sobre las acciones que los usuarios realizan al sistema; además, sirve para protegerse de algún fraude o intento de daño al sistema, puesto que toda acción realizada se registra acá');
INSERT INTO `glb_ayuda` VALUES (16, 191, 'Esta pantalla sirve para crear o restaurar respaldos (backups) de la base de datos del sistema', 'Con esto se brinda mayor seguridad y respaldo a toda la información y registros del sistema ante cualquier problema que pueda surgir en el futuro');
INSERT INTO `glb_ayuda` VALUES (17, 168, 'Esta es la pantalla de inicio del sistema, en donde se visualizan la misión, la visión y los valores institucionales; además, se muestran gráficos de avance de los distindos PEI creados', 'Con esta pantalla se brinda una interfaz amigable, de fácil de uso y acceso rápido a todas las opciones del sistema');
INSERT INTO `glb_ayuda` VALUES (18, 176, 'Esta pantalla es la encargada de configurar toda la estructura correspondiente al Plan Estratégico Institucional, dando así el inicio a todo el proceso', 'Es muy importante que esta información esté claramente definida ya que a partir de este proceso en adelante todo se hará según se haya estructurado acá');
INSERT INTO `glb_ayuda` VALUES (19, 181, 'En esta pantalla se registra toda la información correspondiente a cada uno de los niveles definidos en la estructura del PEI', 'Con esta información el Plan Estratégico Institucional queda totalmtente terminado');
INSERT INTO `glb_ayuda` VALUES (20, 177, 'En esta pantalla se ingresa primer nivel referente al Plan Anual de Trabajo definiendo el siguiente paso del proceso', 'Con esta información se une el Plan Estratégico Institucional con el Plan Anual de Trabajo');
INSERT INTO `glb_ayuda` VALUES (21, 178, 'Con esta pantalla se da validación a todas las actividades que se crean por cada una de las unidades del mtps para que procedan a ejecutarse', 'La validación es importante puesto que a través de ella se evitan la ejecución de actividades con metas muy elevadas o que posean una mala definición');
INSERT INTO `glb_ayuda` VALUES (22, 180, 'Desde esta pantalla se registran las diferentes metas que cada unidad del mtps plantea realizar durante el año', 'Con esta información se define lo que cada unidad realizará cada mes del año');
INSERT INTO `glb_ayuda` VALUES (23, 179, 'En esta pantalla se registran los avances realizados a través del cumplimiento de las metas mensuales por cada unidad del mtps', 'Con esta información es posible llevar un mejor control del cumplimiento de las metas mensuales y anuales que cada unidad del mtps debe lograr');
INSERT INTO `glb_ayuda` VALUES (24, 174, 'Desde esta pantalla se pueden generar informes personalizados con los diferentes filtros referentes al avance del Plan Anual de Trabajo', 'Esta información es muy importante puesto que a través de ella es posible visualizar la efectividad en el cumplimiento de las metas de cada unidad del mtps');
INSERT INTO `glb_ayuda` VALUES (99, 94, 'En esta pantalla se realiza el mantenimiento de la información básica de las organizaciones (públicas y privadas). Sólo los campos del paso 1 (Información General) son obligatorios', 'Estas empresas fungen como empleadores que tienen registrados lugares de trabajo, estos lugares de trabajo son el principal insumo dentro proceso de acreditaciones.');
INSERT INTO `glb_ayuda` VALUES (100, 65, 'Este formulario sirve para crear o modificar una solicitud de transporte de una misión oficial ', 'Los datos de la solicitud serán enviados a su superior inmediato o persona delegada para autorizar su solicitud ');
INSERT INTO `glb_ayuda` VALUES (101, 66, 'En esta pantalla se autorizan las solicitudes de transporte de los empleados', 'Una vez autorizada una solicitud pasa al Jefe de transporte para que el asigne vehículo según convenga ');
INSERT INTO `glb_ayuda` VALUES (102, 67, 'Permite ver el estado y datos de la solicitud', 'Los datos de las solicitudes pueden ser consultados en cualquier momento o imprimir la solicitud como tal');
INSERT INTO `glb_ayuda` VALUES (103, 68, 'En esta pantalla se pueden asignar vehículo y motorista, asi como tambien denegar la solicitud', 'Una vez asignado un vehículo, el sistema reserva el tal para el horario espacificado');
INSERT INTO `glb_ayuda` VALUES (104, 69, 'En esta pantalla se ingresan las series de vales de combustibles ', 'Las series de vales de combustibles son distribuidadas a las diferentes oficinas ');
INSERT INTO `glb_ayuda` VALUES (105, 70, 'En esta pantalla se registran los datos tanto cuando un vehículo sale a una misión oficial como cuando regresa', 'Los datos de kilometraje y estado de combustible sirven para monitorear cuando un vehículo necesitará mantenimiento así como para calcular el rendimiento del vehículo por galón de combustible  ');
INSERT INTO `glb_ayuda` VALUES (106, 81, 'En esta pantalla se ingresa la información de las requisiciones de vales de combustible', 'Previo a la entrega de los vales, la requisicón debe ser autorizada ');
INSERT INTO `glb_ayuda` VALUES (107, 83, 'En esta pantalla se registran los datos de las facturas de la gasolinera', 'Las facturas son los documentos que hacen constar el uso de los vales, al registrar la información de la factura los vales son descargados automáticamente en orden   ');
INSERT INTO `glb_ayuda` VALUES (108, 86, 'Muestra  las requisiciones de combustibles que necesitan ser autorizadas, permitiendo cambiar la cantidad que debe ser entregada', 'Antes de entregar los vales de combustibles, la requisición debe ser evaluada por la persona autorizada aprobar la entrega ');
INSERT INTO `glb_ayuda` VALUES (109, 87, 'En esta pantalla se hace la entrega de vales de combustibles', 'Los vales son descargados en orden y entregados según los delegados de cada oficina lleguen a retirarlos, cuando en el sistema se registra la entrega, automáticamente estos estas disponibles para su uso ');
INSERT INTO `glb_ayuda` VALUES (110, 88, 'Esta pantalla permite la modificación de las cantidades de vales asignadas a cada oficina', 'El sistema toma esta información para sugerir cuantos vales se deben de solicitar/entregar  ');
INSERT INTO `glb_ayuda` VALUES (111, 89, 'En esta pantalla se puede ver la información de las requisiciones asi como modificar (siempre y cuando sea posible)', 'La información de la requisición de combustible debe estar estar dsponble en cualquier momento debido a esto esta pantalla permite su consulta');
INSERT INTO `glb_ayuda` VALUES (112, 111, 'Esta pantalla permite ver un detalle de la distribución de vales', 'Esta información está disponible para que pueda ser consultada en cualquier momento');
INSERT INTO `glb_ayuda` VALUES (113, 112, 'En esta pantalla se puede gestionar todos los datos de las herramientas ', 'El combustible no es utilizado solamente por vehiculos, debido a esto esta pantalla permite agregar articulos que hacen uso de él');
INSERT INTO `glb_ayuda` VALUES (114, 114, 'Muestra un informe de consumo de vales en comparación con lo asignado, permitiendo parametrizar algunas variables para obtener información más específica ', 'Esta información es unicamente para su consulta ');
INSERT INTO `glb_ayuda` VALUES (115, 115, 'Como el título lo indica, esta pantalla sirve para ver el consumo de vehículos y herramientas, permitiendo parametrizar para obtener información más específica ', 'Esta información es unicamente para su consulta ');
INSERT INTO `glb_ayuda` VALUES (116, 119, 'Esta pantalla permite la gestion de las fuentes de fondos o fuentes de finaciamento las cuales son las que proveen el dinero para comprar los vales de combustible', 'Para poder mantener actualizada la información de las fuentes de fondos');
INSERT INTO `glb_ayuda` VALUES (117, 123, 'Muestra un informe de consumo de vales entre dos fechas, permitiendo agrupar el resultado en dia, mes y año', 'Esta información es unicamente para su consulta ');
INSERT INTO `glb_ayuda` VALUES (119, 124, 'En esta pantalla se administran las asignaciones de vehículos en las diferentes secciones', 'Para poder solicitar combusitble para un vehiculo, este debe de estar asingado a la sección \r\n');
INSERT INTO `glb_ayuda` VALUES (120, 131, 'Muestra un informe de la cantidad de vales entregada en relación a lo entregado', 'Esta información es unicamente para su consulta ');
INSERT INTO `glb_ayuda` VALUES (121, 135, 'En esta pantalla se puede ver la información de usuario y cambiar la contraseña de inicio de sesión ', 'La contraseña es necesaria para poder entrar al sistema  ');
INSERT INTO `glb_ayuda` VALUES (122, 137, 'En esta pantallas puede ver la información de todas las facturas ingresadas al sistema, asi como eliminar en caso de ser necesario', 'A través de las facturas se hace constar el consumo de combustible en vehículos y herramientas ');
INSERT INTO `glb_ayuda` VALUES (123, 138, 'Este reporte muestra un detalle del consumo de combustible en un mes especifico', 'Esta información es unicamente para su consulta ');
INSERT INTO `glb_ayuda` VALUES (124, 140, 'En esta pantalla se administran las gasolineras proveedoras de combustibles ', 'Los vales son comprados previamente a las gasolineras, debido a esto es importante tener actualizado el listado de proveedores');
INSERT INTO `glb_ayuda` VALUES (125, 147, 'En esta pantalla se administran los factores a evaluar ', 'Esta información sive como insumo para la creación de los perfiles de evaluación');
INSERT INTO `glb_ayuda` VALUES (126, 148, 'En esta pantalla se administran los perfiles de evaluación', 'Un perfil consiste de un grupo de preguntas de diferentes facotores, los cuales sirven para evaluar todos los empleados de un mismo nivel funcional');
INSERT INTO `glb_ayuda` VALUES (127, 150, 'En esta pantalla se realizan las asignaciones de personas para evaluar a una jefatura, además se puede ver las personas que aún no se han asignado  ', 'El listado de asignación es enviado por correo a las jefaturas, una vez que se confirma la asignación, este listado es presentado nuevamente en el sistema al momento de realizar la evaluación ');
INSERT INTO `glb_ayuda` VALUES (128, 151, 'En esta pantalla se realiza la evaluación de desempeño de los empleados, en base a factores previamente definidos para su nivel de cargo funcional', 'A través de la evaluación se permite conocer el desempeño desde el punto de vista de la jefatura, la calificación obtenida por cada persona es procesada para obtener notas por oficina, nivel y dirección ');
INSERT INTO `glb_ayuda` VALUES (129, 152, 'En esta pantalla se administran las capacitaciones que el empleado/jefe podrá elegir una vez finalice la evaluación ', 'Las capacitaciones más solicitadas son las que se gestionan para poder ser impartidas ');
INSERT INTO `glb_ayuda` VALUES (130, 153, 'Las capacitaciones mas solicitadas son enviadas al sistema de capacitaciones para poder ser gestionadas', 'Esta información sirve como referencia para conocer las áreas o aspectos que necesitan ser mejorados en el personal   ');
INSERT INTO `glb_ayuda` VALUES (131, 154, 'En esta pantalla se revisan aquellas evaluaciones en las cuales hubo inconformidad del empleado evaluado', 'La nota obtenida en la revisión es puesta por un comité y sustituye la primera nota establecida por la jefatura ');
INSERT INTO `glb_ayuda` VALUES (132, 155, 'Pantalla de bienvenida ', '');
INSERT INTO `glb_ayuda` VALUES (133, 157, 'En esta pantalla se administran las áreas  de las posibles capacitaciones a desarrollar	Las capacitaciones estan agrupadas en areas con el fin de que sea más fácil al usuario encontrar un tema en específico', 'Las capacitaciones están agrupadas en áreas con el fin de que sea más fácil al usuario encontrar un tema en especifico');
INSERT INTO `glb_ayuda` VALUES (134, 158, 'En esta pantalla se administran las ediciones de evaluaciones, pudiendo crear, modificar, eliminar o aplicar configuraciones según se requiera', 'Los datos que se muestran tanto en los reportes como en la evaluación son basados en las configuraciones de la edición activa');
INSERT INTO `glb_ayuda` VALUES (135, 166, 'En esta pantalla se puede ver el reporte de las capacitaciones más solicitadas', 'Esta información ayuda a la toma de decisiones respecto a la capacitación que debería ser programada');
INSERT INTO `glb_ayuda` VALUES (136, 182, 'En esta pantalla se pueden ver diferentes reportes relacionados con las puntuaciones de las personas evaluadas', 'Esta información proporciona una idea general sobre el desempeño que está  teniendo el personal desde el punto de vista de su superior ');
INSERT INTO `glb_ayuda` VALUES (137, 184, 'En esta pantalla se gestiona el envio de contraseñas a las personas evaluadoras', 'Además de poder enviar las claves, se puede apreciar si el usuario ha confirmado que sus datos están correctos');
INSERT INTO `glb_ayuda` VALUES (138, 187, 'En esta pantalla se muestra un reporte sobre las razones por las cuales algunas  personas no pudieron ser evaluadas', 'Con esta información se puede saber la cantidad de personas que seran evaluadas en el periodo extraordinario ');
INSERT INTO `glb_ayuda` VALUES (139, 82, 'Aqui se realizan las autorizaciones de las requisiciones', 'Las requisciones autorizadas son las unicas que pueden ser entregadas');
INSERT INTO `glb_ayuda` VALUES (140, 90, 'Esta es la primera pantalla que verá una vez haya iniciado sesión. Su contenido variará según el rol que tenga asignado su usuario.', 'La función de esta\r\npantalla es poder darle al usuario un vistazo rápido de la información que se ha ingresado\r\nhasta ese momento.');
INSERT INTO `glb_ayuda` VALUES (141, 107, 'En esta pantalla se realiza el mantenimiento de la información básica de los lugares de trabajo. Sólo los campos del paso 1 (Información General) son obligatorios', 'Los lugares de trabajo son el principal insumos dentro del proceso de acreditaciones. A cada lugar de trabajo se le asigna un técnico educador para que vaya visitarlo, ya sea para promocionar la ley o para verificar el cumplimiento de la misma, así como tambíen para impartir capacitaciones a sus empleados.');
INSERT INTO `glb_ayuda` VALUES (142, 132, 'En esta pantalla se realiza la asignación de visita de un técnico educador para que vaya a realizar la promoción de la ley a un lugar de trabajo que no haya sido visitado y que su ubicación esté dentro del departamento en el que labora.', 'Al relacionar un lugar de trabajo con un técnico educador este podrá programar la fecha y hora en que irá a realizar la visita.');
INSERT INTO `glb_ayuda` VALUES (143, 96, 'En esta pantalla el técnico educador programa la fecha y hora en que irá a realizar la visita de promoción de ley a los lugares de trabajo que tiene asignados.', 'Al programar una fecha y hora de visita podrá crear una ruta de visitas. Además, el sistema mostrará una alerta indicando que tiene visitas programadas próximas a llevarse a cabo.');
INSERT INTO `glb_ayuda` VALUES (144, 109, 'En esta pantalla el técnico educador podrá ver la calendarización mensual y diaria de sus visitas, tanto de promoción de la ley como las visitas de verificación de cumplimiento', 'Es una consulta rápida de las actividades que tiene programadas.');
INSERT INTO `glb_ayuda` VALUES (145, 95, 'En esta pantalla se realiza el ingreso de los datos de la visita de promoción de la ley. También se ingresa (o se modifica si fuera necesario) la información que quedó\r\nincompleta cuando se registró el empleador y el lugar de trabajo .', 'Dependiendo de los resultados de la visita el lugar de trabajo puede o no necesitar la creación de un comité. Si fuera necesario que se forme el comité, el lugar de trabajo continuará en el siguiente proceso, que es la presentación de los empleados que pasarán a formar parte de dicho comité.');
INSERT INTO `glb_ayuda` VALUES (146, 108, 'En esta pantalla se realiza el mantenimiento de los datos relacionados a los empleados de los lugares de trabajo que requieran la creación de un comité.', 'Los datos ingresados en esta pantalla sirven para poder identificar al personal del lugar de trabajo que conformará el comité, llevar el control de la asistencia a la capacitación inicial y creación de la documentación que acredite dicho comité.');
INSERT INTO `glb_ayuda` VALUES (147, 98, 'En esta pantalla se realiza el mantenimiento de las capacitaciones, asignando a uno o dos técnicos para impartir dichas capacitaciones a los empleados de los lugares de trabajo.', 'El objetivo es programar a los empleados de los lugares de trabajo a la capacitación inicial y verficar su asistencia.');
INSERT INTO `glb_ayuda` VALUES (148, 99, 'En esta pantalla se registra la asistencia de los empleados de los lugares de trabajo a la capacitación que fueron programados. También se crea la lista de asistencia para que firmen.', 'Para que pueda ser acreditado un lugar de trabajo todos los empleados que conformarán el comité tienen que haber asistido a esta capacitación, sino cumplen esta condición no pueden ser acreditados.');
INSERT INTO `glb_ayuda` VALUES (149, 126, 'En esta pantalla se realiza la aprobación del proceso de acreditación, registrando la fecha en que se realizó y el establecimiento el cargo a desempeñar de cada miembro del comité.', 'La distribución de los cargos a desempeñar dentro del comité serán utilizados al momento de la creación de los documentos de la acreditación.');
INSERT INTO `glb_ayuda` VALUES (150, 127, 'En esta pantalla se realiza la creación de la documentación del comité y de las acreditaciones.', 'La vigencia de la acreditación de los comités dependerá de fecha en que se retire la documentación.');
INSERT INTO `glb_ayuda` VALUES (151, 133, 'En esta pantalla se realiza la asignación de visita de un técnico educador para que vaya a realizar la verificación del cumplimiento de la ley a un lugar de trabajo que no haya sido visitado y que su ubicación esté dentro del departamento en el que labora.', 'Al relacionar un lugar de trabajo con un técnico educador este podrá programar la fecha y hora en que irá a realizar la visita.');
INSERT INTO `glb_ayuda` VALUES (152, 102, 'En esta pantalla el técnico educador programa la fecha y hora en que irá a realizar la visita de verificación de cumplimiento de la ley a los lugares de trabajo que tiene asignados.', 'Al programar una fecha y hora de visita podrá crear una ruta de visitas. Además, el sistema mostrará una alerta indicando que tiene visitas programadas próximas a llevarse a cabo.');
INSERT INTO `glb_ayuda` VALUES (153, 103, 'En esta pantalla se realiza el ingreso de los datos de la visita de verificación de cumplimiento de la ley.', 'Crear un registro de la situación actual del lugar de trabajo referente al cumplimiento de la ley.');
INSERT INTO `glb_ayuda` VALUES (154, 92, 'En esta pantalla se muestra el reporte que contiene el consolidado de datos referente a las promociones de ley realizadas.', 'Obtener de forma eficiente y eficáz la información en diferentes formatos (Pantalla, pdf, hoja de cálculo).');
INSERT INTO `glb_ayuda` VALUES (155, 128, 'En esta pantalla se muestra el reporte que contiene el consolidado de datos referente a las capacitaciones realizadas.', 'Obtener de forma eficiente y eficáz la información en diferentes formatos (Pantalla, pdf, hoja de cálculo).');
INSERT INTO `glb_ayuda` VALUES (156, 129, 'En esta pantalla se muestra el reporte que contiene el consolidado de datos referente a las acreditaciones entregadas.', 'Obtener de forma eficiente y eficáz la información en diferentes formatos (Pantalla, pdf, hoja de cálculo).');
INSERT INTO `glb_ayuda` VALUES (157, 130, 'En esta pantalla se muestra el reporte que contiene el consolidado de datos referente a las verificaciones de cumplimiento de la ley realizadas.', 'Obtener de forma eficiente y eficáz la información en diferentes formatos (Pantalla, pdf, hoja de cálculo).');
INSERT INTO `glb_ayuda` VALUES (158, 145, 'En esta pantalla se muestra el reporte que contiene el consolidado de datos de los incumplimientos detectados en los lugares de trabajo.', 'Obtener de forma eficiente y eficáz la información en diferentes formatos (Pantalla, pdf, hoja de cálculo).');
INSERT INTO `glb_ayuda` VALUES (159, 134, 'En esta pantalla se muestra el reporte mensual de las actividades del proceso de acreditaciones.', 'Obtener de forma eficiente y eficáz la información en diferentes formatos (Pantalla, pdf, hoja de cálculo).');
