INSERT INTO `pat_item` VALUES (78, 19, 39, 'R6.OE4', 'Impulsado el proceso de ratificación y cumplimiento de Convenios que contribuyen al fortalecimiento de los derechos laborales y de igualdad de género.', 71, '2015-06-05 04:30:28', 22, '2015-10-22 09:22:10', 30);
