INSERT INTO `pat_item` VALUES (259, 20, 86, 'I-11.R5.OE3', '100%  de  las  empresas  que  tramitan  Reglamentos    Internos  de Trabajo,  incluyen  lenguaje  inclusivo  y  acciones  afirmativas  para  superar inequidades de género.', 77, '2015-10-22 09:47:51', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (260, 20, 43, 'I-12.R5.OE3', 'Al  2019  las  oficinas  departamentales  del país cuentan con el Servicio de Intervención Conciliatoria  Individual  y  Colectiva,  para  la atención de diferencias laborales.', 77, '2015-10-22 09:48:40', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (261, 20, 20, 'I-13.R5.OE3', 'Al 2019 100% de conciliaciones individuales y colectivas realizadas con calidad y calidez, para  la  efectiva  resolución  de  conflictos laborales.', 77, '2015-10-22 09:49:36', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (262, 20, 39, 'I-14.R6.OE4', 'Durante  el  quinquenio  se  promueve  la ratificación  de  al  menos  3  Convenios Internacionales de la OIT.', 78, '2015-10-22 09:50:19', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (263, 20, 39, 'I-15.R7.OE4', 'Al  menos  3  áreas  temáticas  de  derechos laborales  y  género,  posicionadas  durante  el quinquenio  a  través  de  la  articulación internacional.', 79, '2015-10-22 09:50:50', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (264, 20, 39, 'I-16.R7.OE4', '100%  de  observaciones  recibidas, respondidas  oportunamente  a  partir  de 2015.', 79, '2015-10-22 09:51:11', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (265, 20, 116, 'I-17.R8.OE5', 'Al  2015  se  cuenta  con  una  Política  de Igualdad  de  Género,  Plan  de  Acción  y Presupuesto.', 113, '2015-10-22 09:51:40', 696, NULL, NULL);
