INSERT INTO `pat_item` VALUES (267, 20, 116, 'I-19.R8.OE5', 'Al 2015 la articulación ministerial y sectorial, fortalecida  para  la  incidencia  en  el  pleno ejercicio de los derechos de las mujeres.', 113, '2015-10-22 09:52:23', 696, '2015-10-22 09:59:19', 696);
INSERT INTO `pat_item` VALUES (268, 20, 19, 'I-20.R9.OE5', 'Al  2019  al  menos  el  80%  del  personal  ha mejorado  sus  capacidades  para  el  buen desempeño en su rol de servicios.', 114, '2015-10-22 09:52:53', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (269, 20, 108, 'I-21.R9.OE5', 'Al  final  del  2019,  el  100%  de  los  servicios del  MTPS  están  instalados  en  una  plataforma    virtual  para  ofrecer  amplia cobertura,  basado  en  un  sistema  de indicadores de servicios de calidad.', 114, '2015-10-22 09:53:24', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (270, 20, 165, 'I-22.R9.OE5', 'Al  2019  se  ha  implementado  la  Estrategia Ambiental Institucional.', 114, '2015-10-22 09:53:43', 696, NULL, NULL);
INSERT INTO `pat_item` VALUES (271, 20, 36, 'I-23.R9.OE5', 'Al  2019,  4  centros    recreativos  renovados  y adaptados  para  la  formación  y  recreación, han  incrementado  el  promedio  de  visitas  de personas usuarias en un 50%.', 114, '2015-10-22 09:54:07', 696, NULL, NULL);
