INSERT INTO `pat_logro` VALUES (429, 212, 4, 2016, 0, 0, 'El desarrollo de esta actividad esta sujeto a la recepción formal del Sistema una vez se haya superado la gestión académica en la UES por parte del equipo de desarrollo, actualmente no se cuenta con una fecha oficial para dicho tramite.', '2016-09-16 10:03:39', 912, NULL, NULL);
