INSERT INTO `pat_logro` VALUES (432, 199, 5, 2016, 1, 0, 'Se brindaron 23 mantenimientos correctivos y preventivos a la infraestructura de comunicaciones institucional', '2016-09-16 10:05:58', 912, NULL, NULL);
INSERT INTO `pat_logro` VALUES (433, 201, 5, 2016, 1, 0, 'Se brindaron 207 soportes técnicos al equipo informático institucional. Se brindaron 17 msntenimientos preventivos al equipo informático institucional. ', '2016-09-16 10:05:58', 912, NULL, NULL);
INSERT INTO `pat_logro` VALUES (434, 202, 5, 2016, 1, 0, 'Sistemas Internos -->  Intranet: Generación de respaldo semanal de sitio web y su base de datos. SITCOM: Asistencia a usuarios por actualización de credenciales de accesos en el Serviddor Principal AD.. SIB: Revisión y corrección del reporte 6 ya que no presentaba salidas desde mayo. SNIT: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios del sistema.  Se realizarón reuniones con la Secretaria Técnica de la Presidencia de la República, para continuar con la exposición de la nueva versión adaptada por los técnicos designados de esa institución. Se brindo apoyo a la Secretaria Técnica de la Presidencia de la República. Renacempleo: Se realizó respaldo del sistema y base de datos. Se realizó mantenimiento y soporte permanente a los usuarios del sistema.\nSistemas Externos -->  Sitio Web Institucional: Generación de respaldo semanal de sitio web y su base de datos. ', '2016-09-16 10:05:58', 912, NULL, NULL);
INSERT INTO `pat_logro` VALUES (435, 204, 5, 2016, 0, 0, '', '2016-09-16 10:05:58', 912, NULL, NULL);
