INSERT INTO `pat_logro` VALUES (438, 208, 5, 2016, 0, 0, 'Esta actividad esta sujeta a la finalización de la actividad 6.', '2016-09-16 10:05:58', 912, NULL, NULL);
INSERT INTO `pat_logro` VALUES (439, 209, 5, 2016, 0, 0, 'Se han realizado gestiones con entidades de educación superior para contar con un equipo de estudiantes en servicio social que apoyen este proyecto, en caso de contar con ellos se tomaran medidas alternas.', '2016-09-16 10:05:58', 912, NULL, NULL);
