INSERT INTO `pat_logro` VALUES (453, 208, 6, 2016, 0, 0, '', '2016-09-16 10:13:29', 912, NULL, NULL);
INSERT INTO `pat_logro` VALUES (454, 209, 6, 2016, 1, 0, 'Se desarrolló primera versión de la herramienta para registrar el plan de capacitaciones institucional, se ha mantenido un formato similar al utilizado en la evaluación del desempeño con variantes propias de la herramienta utilizada en la nueva versión. Se utilizó una herramienta libre que puede ser accedida desde cualquier dispositivo con acceso a internet.', '2016-09-16 10:13:29', 912, NULL, NULL);
INSERT INTO `pat_logro` VALUES (455, 210, 6, 2016, 1, 0, 'Se desarrolló primera versión de la herramienta para medir el clima laboral, la misma es conforme al formato obtenido del departamento de RRHH durante el año 2015. Se utilizó una herramienta libre que puede ser accedida desde cualquier dispositivo con acceso a internet.', '2016-09-16 10:13:29', 912, NULL, NULL);
INSERT INTO `pat_logro` VALUES (456, 215, 6, 2016, 1, 0, 'Reunión con Direcciones y Unidades Asesoras para dar a conocer la participación de cada una de ellas en el proceso de desarrollo e implementación del proyecto. Recopilación de un porcentaje de documentación a incluir en la Nueva Intranet. Implementación de  Intranet provisional', '2016-09-16 10:13:29', 912, NULL, NULL);
INSERT INTO `pat_logro` VALUES (457, 216, 6, 2016, 1, 0, 'Soporte permanente a los usuarios del sistema', '2016-09-16 10:13:29', 912, NULL, NULL);
