INSERT INTO `pat_logro` VALUES (1047, 1368, 1, 2017, 1, 0, 'Instalación de consola de Antivirus Sophos en Oficina Regionales de San Miguel y Santa Ana, y en Oficina Departamental de Cojutepeque. Apoyo en la instalación de equipo de alojamiento SAN para ser configurado en oficina Central. Apoyo en la limpieza en la área de servidores. Implementación de VLAN de recurso Humano para la descarga de naciones de los relojes marcadores. Instalación de equipos nuevos en la UFI. El efecto cascado producto de la liberación de equipos de UFI (beneficiando a otras áreas de la institución). Construcción de Red de Área Local en Oficina Departamental de Morazán (8 Puntos de Red de Datos). Puesta en marcha de computadoras en Centro Recreativo El Tamarindo para el proyecto de Centros de Formación.', '2017-02-07 12:59:31', 868, '2017-02-14 14:42:56', 868);
INSERT INTO `pat_logro` VALUES (1048, 1369, 1, 2017, 233, 0, 'Se realizaron los siguientes soportes por zona geográfica: Zona Central= 138, Zona Occidental= 65 y Zona Oriental = 30. Un total de 233 soportes técnicos.', '2017-02-07 12:59:31', 868, '2017-02-13 14:41:11', 868);
INSERT INTO `pat_logro` VALUES (1049, 1370, 1, 2017, 0, 0, 'Esta actividad tuvo que reprogramarse, debido a que se realizaron otras actividades prioritarias. (Ver observaciones de la actividad No.1 de la Acción A30.I-21.R9.OE5', '2017-02-07 12:59:31', 868, '2017-02-14 14:46:49', 868);
INSERT INTO `pat_logro` VALUES (1051, 1372, 1, 2017, 1, 0, 'De acuerdo a lo expresado por el jefe de la Unidad, se han hecho gestiones para contar con el código completo del proyecto, ya que a la fecha han no se ha logrado desplegar de forma correcta.', '2017-02-07 12:59:31', 868, '2017-02-17 13:27:33', 868);
INSERT INTO `pat_logro` VALUES (1052, 1374, 1, 2017, 1, 0, 'Se corrigieron fallas sobre el despliegue realizado en diciembre 2016, se realizaron dos jornadas de capacitación para el personal que utilizará los módulos: Compra y Bodega. Se cargo al sistema el inventario de bodega de cierre del mes de diciembre 2016 con éxito. Se tomó nota para hacer mejoras y revisar ambos módulo durante febrero 2016.', '2017-02-07 12:59:31', 868, '2017-02-17 13:32:43', 868);
INSERT INTO `pat_logro` VALUES (1053, 1375, 1, 2017, 1, 0, 'Se desarrollo una reunión de seguimiento con los estudiantes y se propuso realizar visitas de campo a un centro de recreación y a una institición gubernamental, para validar los procesos que realizan de forma manual y en el sistema de recursos humanos respectivamente.', '2017-02-07 12:59:31', 868, '2017-02-17 13:32:43', 868);
INSERT INTO `pat_logro` VALUES (1054, 1387, 1, 2017, 1, 0, 'Migración de Base a servidor Físico. Creación de la base de datos bonita. Creación del esquema de la base de datos. 	Configuración de servidor de aplicación. Creación de Usuarios a nivel nacional. Habilitación de procesos con conectividad al servidor de SQL Server 2014. Cambio de Hostname de SNIT versión nueva. Informe de actividades de la fase de  implementación del sistema. Cambios en el aplicativo solicitados por los usuarios.', '2017-02-07 12:59:31', 868, '2017-02-17 13:35:59', 868);
INSERT INTO `pat_logro` VALUES (1055, 1366, 1, 2017, 1, 0, 'Se desplegó el servidor en producción (Centos 6.4), junto a estudiantes en servicio social se corrigieron fallas respecto de versiones de componente y plugins. Se programaron jornadas de capacitación a desarrollar en el mes de febrero', '2017-02-07 12:59:31', 868, '2017-02-20 10:31:03', 868);
INSERT INTO `pat_logro` VALUES (1056, 1367, 1, 2017, 1, 0, 'Se desplegó el servidor en producción (Ubuntu 12.04), junto a estudiantes en servicio social se corrigieron fallas del código sobre el uso de comandos keysensitive (uso de mayúsculas y minúsculas). Se programaron jornadas de capacitación a desarrollar en el mes de febrero.', '2017-02-07 12:59:31', 868, '2017-02-20 10:31:37', 868);
