INSERT INTO `pat_logro` VALUES (1574, 1657, 1, 2017, 1, 0, 'Sistema de Evaluación de Desempeño: Se apoyó el proceso de evaluación y se capacitó a dos personas de RRHH para poder realizar ajustes y consultas en el sistemas. En el sitio web institucional se realizaron 11 publicaciones de contenido. Se realizó respaldo de la carpeta principal y de la base de datos. Sistema Nacional de Inspecciones de Trabajo: Se realizó respaldo de la base de datos y sistema. Soporte a las personas usuarias. Des-habilitación de procesos de toma de solicitud en el SNIT (Versión Antigua). Cambio de Hostname de SNIT (Versión Antigua a Versión Nueva).  Se realizó respaldo de la base de datos y sistema y soporte a las personas usuarias para los sistemas: Sistema de Intermediación de Empleo (Renacemepleo),  Sistema Nacional de Empleo y Sistema Nacional de Notificaciones de Accidentes.', '2017-02-20 09:59:04', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (1575, 1656, 1, 2017, 1, 0, 'Creación de 3 cuentas de correo electrónico institucional  y reestablecido 8. En la Intranet se realizaron 4 publicaciones, también se realizó respaldo de la carpeta principal y su base de datos. Configuración de 24 softphone para el Depto. Nacional de Empleo y la UFI.', '2017-02-20 10:16:16', 868, '2017-02-20 10:20:40', 868);
