INSERT INTO `pat_logro` VALUES (2115, 1372, 2, 2017, 1, 0, 'Se tiene conocimiento que el Ing. Francisco Sánchez ha realizado gestiones ante la UES, para contar con el código completo y puesta en producción de este proyecto ya que ha la fecha ha sido imposible desplegarlo por presentar fallas de programación y compilación.', '2017-03-08 10:44:10', 868, '2017-03-08 11:31:04', 868);
INSERT INTO `pat_logro` VALUES (2116, 1366, 2, 2017, 1, 0, 'Se realizaron tres jornada de capacitacíon tipo taller, sobre los módulos: Aprobación de reglamentos y conciliación individual con un total de 21 personas capacitadas. El sistema se ha probado desde los equipos de los usuarios.', '2017-03-08 10:44:10', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (2117, 1367, 2, 2017, 1, 0, 'Se realizaron dos jornadas de capacitación tipo taller, con un total de 5 personas capacitadas, entre las cuales figura la Directora General de Trabajo, jefaturas y colaboradoras y colaboradores jurídicos.', '2017-03-08 10:44:59', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (2118, 1657, 2, 2017, 1, 0, '*Sistema Nacional de Inspecciones de Trabajo (Versión Antigua) SNIT: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios del sistema. Informes del funcionamiento del sistema nueva versión y antigua versión: 1. Informe del grado de cumplimiento de la Oficina Departamental de San Vicente. 2. Informe del grado de cumplimiento dela Oficina Departamental de Zacatecoluca. 3. Informe del grado de cumplimiento de la Oficina Departamental de Cabañas. 4. Informe del grado de cumplimiento de la Oficina Departamental de Cuscatlán.*Se realizó respaldo de la carpeta principal y base de datos de los sistemas: Sistema de Intermediación de Empleo (Renacemepleo), Sistema Nacional de Empleo, Sistema Nacional de Notificaciones de Accidentes. Sistema Integral de Bodega SIB: Se brindó apoyo en la generación de reportes 3 y 6 de bodega para cuadratura con contabilidad. *En el sitio web institucional se realizaron 6 publicaciones de contenido. Se realizó respaldo de la carpeta principal y de la base de datos.', '2017-03-08 11:25:47', 868, '2017-03-08 11:28:57', 868);
INSERT INTO `pat_logro` VALUES (2119, 1374, 2, 2017, 1, 0, 'Se han realizado pruebas de seguimiento en la implementación, partiendo del inventario de cierre de 2016, se continua registrando los pedidos de enero 2017 y compras de productos y servicios.', '2017-03-08 11:28:20', 868, '2017-03-08 11:33:29', 868);
INSERT INTO `pat_logro` VALUES (2120, 1375, 2, 2017, 1, 0, 'El equipo de desarrollo ha realizado visitas de campo a las centros de recreación y FISDL para comprender de mejor manera los procesos existentes en lada centro de recreación y  proyectar posibles funciones a aplicar en el sistema de recurso humanos partiendo del sistema mostrado por el FISDL.', '2017-03-08 11:28:57', 868, '2017-03-08 11:34:15', 868);
INSERT INTO `pat_logro` VALUES (2121, 1387, 2, 2017, 1, 0, 'Sistema Nacional de Inspecciones de Trabajo (versión nueva): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios del sistema. Creación de Usuarios en el sistema. Implementación SNIT (versión Mejorada). Capacitaciones refuerzo a la Oficina Departamental de San Vicente y Oficina de Zacatecoluca. Informes del funcionamiento del sistema nueva versión: Informe de costo del  sistema nacional de inspección de trabajo (SNIT- versión mejorada). Informe registros de inspección registrados en el sistema versión mejorada 1-3 de febrero. Informe registros de inspección registrados en el sistema versión mejorada 6-11 de febrero. Informe registros de inspección registrados en el sistema versión mejorada 13-17 de febrero. Informe registros de inspección registrados en el sistema versión mejorada 20-25 de febrero. Informe diligencias de inspección febrero total.', '2017-03-08 11:29:48', 868, '2017-03-08 13:18:14', 868);
INSERT INTO `pat_logro` VALUES (2122, 1656, 2, 2017, 1, 0, 'Se realizó la  asignación de 29 teléfonos celulares institucionales, se realizó el cambio de 2 teléfonos IP  en el Departamento Nacional de Empleo y se atendió falla general de telefonía. En la Intranet se realizó respaldo de la carpeta principal y su base de datos. ', '2017-03-08 13:10:37', 868, NULL, NULL);
