INSERT INTO `pat_logro` VALUES (2908, 1656, 3, 2017, 1, 0, 'Intranet (Actual):  Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-04-07 14:44:03', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (2909, 1387, 3, 2017, 1, 0, 'Actividades realizadas: Actualización de información del sistema: Motivos de inspecciones especiales, motivos de planes, listado de planes programados, origen de planes, listado de infracciones, motivos de archivo. Diseño de flujo de reinicio de casos de inspección. Elaboración de informe sobre casos de inspección diligenciados en febrero 2017. Elaboración de informe de incidencias del sistema.', '2017-04-07 14:45:03', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (2910, 1375, 3, 2017, 1, 0, 'Actividad realizada: El equipo se ha reunido con las áreas de RRHH y Viáticos, se encuentran en etapa de aprobación de perfil de proyecto.', '2017-04-07 14:46:03', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (2911, 1374, 3, 2017, 1, 0, 'Actividades realizadas: Se cuenta con el despliegue y pruebas de los módulos de compra y bodega, así mismo ambos cuentan con registro de prueba y en el caso de bodega se ha logrado ingresar transacciones del primer trimestre. El módulo de activos fijos se encuentra en desarrollo.', '2017-04-07 14:47:03', 868, '2017-05-02 11:09:57', 20);
INSERT INTO `pat_logro` VALUES (2912, 1657, 3, 2017, 1, 0, '*Sistema Nacional de Inspección de Trabajo (Antiguo). Sistema de Intermediación de Empleo (Renacempleo). Sistema Nacional de Empleo. Sistema de Notificaciones de Accidentes de Trabajo. Sistemas de Fichas de Empleados. Sistema Integral de Bodega. Sistema de Transporte. Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-04-07 14:48:03', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (2913, 1367, 3, 2017, 1, 0, 'Actividades realizadas: Se desarrollaron actividades de seguimiento de cara a la implementación del sistema en un nuevo servidor físico, a fin de que este disponible desde Internet y no afecte la seguridad de los otros aplicativos de uso administrativo.', '2017-04-07 14:48:30', 868, '2017-05-02 11:09:57', 20);
INSERT INTO `pat_logro` VALUES (2914, 1366, 3, 2017, 1, 0, 'Actividades realizadas: El sistema se desplego en ambiente de producción y se desarrollaron capacitaciones con las áreas involucradas. La puesta en marcha se ha detenido debido a una incidencia en el registro de fechas que no permite realizar el flujo completo de algunos expedientes. Se han tenido sesiones remotas con el equipo de desarrollo para superarlas pero a la fecha la incidencia persiste.', '2017-04-07 14:49:03', 868, '2017-05-02 11:09:57', 20);
INSERT INTO `pat_logro` VALUES (2915, 1372, 3, 2017, 0, 0, 'Actividad realizada: Se realizaron gestiones con representantes del a UES para apoyar la puesta en producción de este sistema, y como resultado se ha concluido que es viable contar con otro equipo que realice su trabajo de graduación desarrollando nuevamente el sistema con los insumos de análisis y diseño del esfuerzo inicial.', '2017-04-07 14:45:03', 868, '2017-05-02 11:10:43', 20);
INSERT INTO `pat_logro` VALUES (2916, 1370, 3, 2017, 58, 0, 'Se realizaron 58 mantenimientos a computadoras de escritorio de las dependencias: Oficina Regional de San Miguel, Oficinas Departamentales de Usulután, La Unión, Cabañas, Oficinas Centrales (DGT, DRIT, Unidad de Asesoría Jurídica, Depto. Organizaciones Sociales).', '2017-04-07 14:51:03', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (2917, 1368, 3, 2017, 1, 0, 'Actividades realizadas: Actualización de credenciales de acceso para el servicio de conexión inalámbrica institucional. Instalación y configuración de ambientes virtuales de para desarrollo de nuevos aplicativos institucionales. Reconfiguración de servidor de correo electrónico institucional. Instalación de nuevo antivirus en la Oficina departamental de Chalatenango y la Oficina Paracentral de la Paz (Zacatecoluca). Solución de problemas del servicio de Internet en las Oficinas Departamentales de Sonsonate y Chalatenango.', '2017-04-07 14:52:03', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (2918, 1369, 3, 2017, 268, 0, 'Se realizaron los siguientes soportes por zona geográfica: Zona Central=115, Zona Occidental=79 y Zona Oriental=34. Un total de 268 soportes técnicos.', '2017-04-07 14:53:03', 868, '2017-05-02 11:09:57', 20);
