INSERT INTO `pat_logro` VALUES (3731, 1368, 4, 2017, 1, 0, 'Creación y publicación de encueta pública \"Sondeo abierto para la Política Nacional de Empleo\".\nInstalación y configuración de 12 equipos móviles para portar encuesta pública.\nCapacitación  a personal de la Oficina de Estadística sobre el uso de los equipos móviles y llenado de encuesta pública.\nSolución de falla del servicio de Internet en el Centro Recreativo Conchalio.\nApoyo a la Oficina de Prensa para la transmisión de video del evento del Centro Recreativo El Tamarindo.\n\n', '2017-05-12 14:14:39', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (3732, 1370, 4, 2017, 12, 0, 'Se realizaron 12 mantenimientos a computadoras de escritorio en la sección de Reglamentos Internos de la DGT.', '2017-05-15 10:44:20', 868, '2017-05-15 10:46:22', 868);
INSERT INTO `pat_logro` VALUES (3733, 1369, 4, 2017, 108, 0, 'Se realizaron los siguientes soportes por zona geográfica: Zona Central=46, Zona Occidental=36 y Zona Oriental=26. Un total de 108 soportes técnicos.', '2017-05-15 10:46:22', 868, '2017-05-15 10:48:41', 868);
INSERT INTO `pat_logro` VALUES (3734, 1657, 4, 2017, 1, 0, 'SICBAF: Se continua trabajando en ajustes a los módulos de compras y activo fijo.\n\n SIPLAN: Se ha trabajado en el ajuste de procedimientos para facilitar el ingreso de registros. Se ha trabajado en verificar mejoras en la generación de gráficos y reportes que también puedan ser consultados desde la intranet.\n\nSISRICAR: Se cuenta con fallas en la configuración de fechas y por ello no se logra desarrollar todos los procesos que requiere un expediente.\n\nSIGAP: Con apoyo del Director de la Escuela de Ingenieria (Ing. Sánchez Cornejo) se esta buscando un equipo en trabajo de tesis para que desarrolle el SIGAP a partir del análisis y desarrollo previo. Sistema Nacional de Inspecciones de Trabajo (versión nueva):  Informes del funcionamiento del sistema nueva versión mes de marzo\n. Portal Nacional de Empleo\n: Reconfiguración de Proyecto del sistema debido a Fallas.\n Respaldo de base de datos y carpeta de los sistemas: Sistema Nacional de Inspecciones de Trabajo (Versión antigua y nueva). Sistema de Intermediación de Empleo (Renacemepleo). Portal Nacional de Empleo\n. Sistema Nacional de Notificaciones de Accidentes. Bodega. Sistema de\nTransporte. Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-05-15 14:19:10', 868, '2017-05-15 14:30:02', 868);
INSERT INTO `pat_logro` VALUES (3735, 1375, 4, 2017, 1, 0, 'Se han desarrollado reuniones con el equipo de desarrollo y personal involucrado en los procesos que lo componen dado como resultado ajustes al perfil de proyecto y aun se encuentra en etapa de validación.', '2017-05-15 14:28:25', 868, '2017-05-15 14:29:30', 868);
