INSERT INTO `pat_logro` VALUES (4625, 883, 5, 2017, 191, 0, 'No se llegó a la meta, hubo dos factores importantes este mes que incidieron en ellos, primero la vacación de semana santa y segundo que no se devolvió por parte de los inspectores el 100% del trabajo que se les entregó no obstante habiéndoseles comunicado a través de un memorando con fecha 24 de abril de 2017.-\n', '2017-06-09 14:24:36', 912, NULL, NULL);
