INSERT INTO `pat_logro` VALUES (4633, 1368, 5, 2017, 1, 0, 'Instalación y configuración de sistema operativo Centos server 6.4 de 64bit para nuevos aplicativos. Limpieza de RACK server en área de servidores. Limpieza externa de aires de presiones en área de servidores. Creación y publicación de encuesta publica SONDEO PARA LA RENDICION DE CUENTAS 2017. Visita en la Oficina de Archivo General MTPS para solventar falla del servicio de internet. Reconfiguración de reglas de protección de sitios institucionales contra ataques para el sitio web snit.mtps.gob.sv Se bloqueó nuevas cuentas de correo a la lista negra debido a envió de correo SPAN.', '2017-06-12 13:11:57', 868, '2017-06-12 13:34:48', 868);
