INSERT INTO `pat_logro` VALUES (4697, 1656, 5, 2017, 1, 0, 'Intranet: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-06-13 10:18:35', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (4698, 1657, 5, 2017, 1, 0, 'Sistema Informático para el Seguimiento de Resolución de Conflictos y Aprobación de Reglamentos Internos de Trabajo: Se busco medios para superar el impase de fechas entre los servidores de aplicación y de base de datos. Sistema de Registro de Contratos Individuales de Trabajo: Se habilito un servidor para la puesta en producción del sistema público. El equipo de desarrollo ha preparado el ambiente de producción y el proceso de migración para el despliegue final. \nSistema de Gestión de Asociaciones Profesionales: Se han mantentido reuniones de trabajo con Duglas Morales, egresado de la carrera de Ingenieria en Sistema de la UES, quien estará a cargo de las mejoras, nuevo módulos y corrección de incidencias al proyecto inicial. Sistema de Procesos Administrativos (Compras - Bodega - Activo Fijo): Se ha desarrollado un plan de trabajo para lograr la implementación del proyecto que representa tres sistemas. Se ha continuado apoyando sistemas como: Evaluación, capacitaciones, RRHH, SIPLAN y SITCOM. Sistema Nacional de Inspecciones de Trabajo (versión nueva):  Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Capacitación a jefaturas de la oficina central en el uso del módulo de consulta expediente. Informes del funcionamiento del sistema nueva versión mes de abril. Sistema Nacional de Inspecciones de Trabajo (versión antigua): Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Sistema de Intermediación de Empleo (Renacemepleo): Respaldo de la base de datos y sistema. Soporte permanente a los usuarios del sistema. Sistema Nacional de Empleo: Respaldo de la base de datos y sistema. Soporte permanente a los usuarios del sistema. Se restableció el proyecto del sistema debido a fallas. Sistema Nacional de Notificaciones de Accidentes: Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-06-13 14:01:12', 868, '2017-06-13 14:01:44', 868);
