INSERT INTO `pat_logro` VALUES (5428, 1533, 6, 2017, 1, 0, 'El día 23 de junio, se participó en el Foro: “Niñez Trabajando en calle, realidad y desafío” (ISNA-RENASCA), Seguimiento a la Programación Operativa de la Hoja de Ruta.', '2017-07-10 11:00:29', 557, NULL, NULL);
INSERT INTO `pat_logro` VALUES (5429, 1534, 6, 2017, 1, 0, 'Actividades conmemorativas del Día contra el Trabajo Infantil.', '2017-07-10 11:00:29', 557, NULL, NULL);
INSERT INTO `pat_logro` VALUES (5430, 1375, 6, 2017, 1, 0, 'Se han mantenido comunicación vía correo electrónico con el equipo de desarrollo y se han programado reuniones de seguimiento para tal fin.', '2017-07-10 11:46:15', 868, '2017-07-10 11:46:52', 868);
