INSERT INTO `pat_logro` VALUES (5433, 1657, 6, 2017, 1, 0, '-Sistema Informático para el Seguimiento de Resolución de Conflictos y Aprobación de Reglamentos Internos de Trabajo: Se ha trabajado con el Egresado Duglas Morales, para poder solventar esta situación mientras aún se encuentra trabajando en el perfil de trabajo de graduación. -Sistema de Registro de Contratos Individuales de Trabajo: Junto al equipo de desarrollo se han superado inconvenientes en la configuración del servidor de producción, pendiente realizar el despliegue final.\n-Sistema de Gestión de Asociaciones Profesionales: Se han mantenido reuniones de trabajo con Duglas Morales, y personal de la DGT para valorar alternativas de solución a la implementación del proyecto SIGAP. -Sistema de Procesos Administrativos (Compras - Bodega - Activo Fijo): Se han mantenido reuniones de seguimiento, capacitaciones, mejoras al desarrollo y ajustes al plan de trabajo inicial, se acordó por parte de los involucrados llegar al mes de agosto a fin de lograr cumplir con las metas establecidas. -Sistema Nacional de Inspecciones de Trabajo (versión nueva):  Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Actualización en base de datos en las tabla Infracciones. Un informe del uso del sistema de Oficina Regional de Occidente. -Sistema Nacional de Inspecciones de Trabajo (versión antigua):  Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sistema de Intermediación de Empleo (Renacemepleo): Soporte permanente a los usuarios del sistema. -Sistema Nacional de Empleo: Soporte permanente a los usuarios del sistema. Se realizó respaldo de la base de datos y sistema. Entrega de Reporte de Vinculación Online al Departamento Nacional de Empleo. -Sistema Nacional de Notificaciones de Accidentes: Soporte permanente a los usuarios del sistema. Se realizó respaldo de la base de datos y sistema. -Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-07-10 11:51:59', 868, '2017-07-10 11:52:21', 868);
INSERT INTO `pat_logro` VALUES (5434, 1387, 6, 2017, 0, 0, '', '2017-07-10 11:52:21', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (5435, 1386, 6, 2017, 0, 0, '', '2017-07-10 11:54:36', 868, '2017-07-10 11:54:51', 868);
INSERT INTO `pat_logro` VALUES (5436, 1656, 6, 2017, 1, 0, 'Instalación de teléfono análogico en paralelo ext. 3889. Intranet: Soporte permanente a\npersonas usuarias. Realización de\nrespaldo de carpeta del sistema y de\nla base de datos.', '2017-07-10 11:54:51', 868, '2017-07-10 14:06:49', 868);
