INSERT INTO `pat_logro` VALUES (5790, 873, 7, 2017, 117, 0, 'No se llegó a la meta, hubo dos factores importantes este mes que incidieron en ellos, primero un fallo en el sistema en la oficina, estando sin red aproximadamente 5 días por lo que no pudo programarse en esos días, asignando únicamente reinspecciones y tiempo a los inspectores para que pudiesen sacar el trabajo pendiente de meses anteriores y segundo que no se devolvió por parte de los inspectores el 100% del trabajo asignado, ocasionando esto también una baja en el número de ispecciones.-\n', '2017-08-09 15:07:57', 435, NULL, NULL);
