INSERT INTO `pat_logro` VALUES (6111, 1368, 7, 2017, 1, 0, 'Apoyo en la limpieza de los equipo de aires acondicionado de precisión de la sala de servidores.  Apoyo en la implementación de nuevo Sistema de Almacenamiento de Información. Configuración de nuevo servidor de virtualización con nuevo espacio de almacenamiento. Configuración de nuevo espacio de almacenamiento para respaldo  de servidor de Base de Datos SNIT. Gestión para que el correo institucional mtrabajo.mtps.gob.sv fuera sacado de lista negra o bloqueo de correo.\nCreación de nuevas reglas en equipo de seguridad perimetral,  para evitar el ingreso no autorizado al correo institicional. Reconfiguración del servidor principal de Active Directory, debido a fallas de replicación de información. Reconfiguración del servidor de réplica de Active Directory debido a fallos de servidor principal. Eliminación de correos Spam en servidor de correo institucional, debido a que el servicio se bloqueó. Reconfiguración nueva IP publica del servidor de correo institucional, debido a los problemas de correos Spam.', '2017-08-16 13:59:27', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (6112, 1369, 7, 2017, 135, 0, 'Se realizaron los siguientes soportes por zona geográfica: Zona Central=61, Zona Occidental=54 y Zona Oriental=20. Un total de 135 soportes técnicos.', '2017-08-16 14:01:13', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (6113, 1370, 7, 2017, 114, 0, 'Se realizaron los siguientes mantenimientos por zona geográfica: Zona Central=31, Zona Occidental=48 y La Libertad=35. Un total de 114 mantenimientos.', '2017-08-16 14:15:49', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (6114, 1386, 7, 2017, 1, 0, 'Gestión para financiar ajustes a la herramienta  de Inteligencia de Negocios. Se espera dar inicio a las mejoras en el mes de septiembre de 2017. ', '2017-08-16 14:20:39', 868, '2017-08-16 15:12:40', 868);
INSERT INTO `pat_logro` VALUES (6115, 1656, 7, 2017, 1, 0, 'Gestión para que el correo institucional mtrabajo.mtps.gob.sv fuera sacado de lista negra o bloqueo de correo. La nueva Intranet fue puesta en marcha a partir del viernes 21 de julio de 2017. Soporte permanente a personas\nusuarias. Realización de respaldo de\ncarpeta del sistema y de la base de\ndatos.\nInstalación  de extesion Telefonica en paralelo (5 MTS.)  ext. 3888.', '2017-08-16 14:24:12', 868, '2017-08-16 14:30:49', 868);
INSERT INTO `pat_logro` VALUES (6116, 1375, 7, 2017, 1, 0, 'Se continua el proceso con la Universidad de El Salvador, Facultad Paracentral de San Vicente. ', '2017-08-16 15:03:59', 868, '2017-08-16 15:12:40', 868);
INSERT INTO `pat_logro` VALUES (6117, 1372, 7, 2017, 0, 0, '', '2017-08-16 15:04:58', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (6118, 1374, 7, 2017, 0, 0, '', '2017-08-16 15:06:41', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (6119, 1657, 7, 2017, 1, 0, '-Se ha brindado soporte a los sistemas administrativos  de uso interno (SIB, SAF, SNNAT, STCOM, SFERH) en procesos como: Ajustes a reportes, incidencias menores de usurios y reesttablecimiento de claves entre otros. -Se continuo haciendo gestión con el Sr. Douglas Morales  enviado de la UES, a fin de continuar con el proceso de depuración e implementación del SISRICAR. -Se desplegó el sistema en un servidor de aplicaciones con sistema operativo CentOS (Linux / libre) sin embargo hubo incindencias que no permitieron la puesta en producción. Se usará otra distribución en la que ya ha sido probado el sistema con el fin de tenerlo en producción durante el mes de agosto de 2017. -Se continuo haciendo gestión con el Sr. Douglas Morales,  enviado de la UES, a fin de continuar con el proceso de depuración e implementación del SIGAP. -Se desarrollaron sesiones de capacitación con el personal de la UACI, adicionalmente se hicieron ajustes en los procesos: registro de solicitudes de compra, registro de productos y se finalizo el módulo de registro de equipo informático vinculado al registro de activos fijos.-Sistema Nacional de Inspecciones de Trabajo (versión nueva): Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Actualización en base de datos en las tabla Infracciones. 3 Informes del uso del sistema. Programación de dos mantenimientos para realizar automáticamente el full backup y un backup diferencial. -Sistema Nacional de Inspecciones de Trabajo (versión antigua): Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. 1 Informes del uso del sistema. Programación de dos mantenimientos para realizar automáticamente el full backup y un backup diferencial. -Sistema de Intermediación de Empleo (Renacemepleo):  Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sistema Nacional de Empleo: Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Entrega a la Oficina de Empleo Reporte de vinculación online mes de julio. -Sistema Nacional de Notificaciones de Accidentes: Respaldo de la base de datos y sistema. Soporte permanente a los usuarios.  de la base de datos y sistema. -Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-08-16 15:15:24', 868, '2017-08-16 15:15:44', 868);
