INSERT INTO `pat_logro` VALUES (7397, 1369, 9, 2017, 250, 0, 'Se realizaron los siguientes soportes por zona geográfica: Zona Central=137, Zona Occidental=75 y Zona Oriental=38. Un total de 250 soportes técnicos.', '2017-10-09 15:23:05', 868, '2017-10-09 15:23:25', 868);
INSERT INTO `pat_logro` VALUES (7398, 1368, 9, 2017, 1, 0, 'Se brindó apoyo informático en el evento de Consejo de Ministros y Ministras. Se realizó modificación en RACK1 en la parte eléctrica debido a daño de UPS. Se realizó limpieza de servidor (mtps-005.0010.08), debido a fallas recurrentes. Se realizó modificaciones en la red de datos de Centro de Recreación para Trabajadoras y Trabajadores El Ttamarindo, debido a fallas del servicio de VPN. Se brindó apoyo en la evaluación de ofertantes de licenciamiento de equipo de seguridad perimetral UTM Sophos. Se brindó apoyo para la verificación de reloj marcador de la Oficina Departamental de La Unión, se encontró que la tarjeta de red de datos está dañada y esto impide la extracción de información. Se brindó apoyo para la reconfiguración del equipo de video conferencia en la Sala del Departamento de Recursos Humanos. Se brindó apoyo en el mantenimiento del equipo de aires de precisión.', '2017-10-09 15:23:25', 868, '2017-10-11 11:38:54', 868);
INSERT INTO `pat_logro` VALUES (7399, 1370, 9, 2017, 139, 0, 'Se realizaron los siguientes mantenimientos por zona geográfica: Zona Central=42, Zona Occidental=29,  Zona Oriental=53 y Zona Paracentral=15. Un total de 139 mantenimientos.', '2017-10-09 15:24:35', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (7400, 1375, 9, 2017, 1, 0, 'Por parte del equipo de desarrollo se presentó plantilla para desarrollo del proyecto, la cual tuvo el visto bueno de los interesados incluyendo al Lic. Luis Mario Flores, Jefe UFI., Se continua en reuniones para revisar las funcionalidades del proyecto en los diferentes sistemas.', '2017-10-11 11:46:51', 868, '2017-10-11 11:47:32', 868);
INSERT INTO `pat_logro` VALUES (7401, 1372, 9, 2017, 0, 0, '', '2017-10-11 11:47:17', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (7402, 1374, 9, 2017, 0, 0, '', '2017-10-11 11:47:32', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (7403, 1656, 9, 2017, 1, 0, '-Intranet: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.          -Directorio MTPS: El viernes 22 de septiembre de 2017 se implemento una herramienta web que sirve de apoyo para la comunicación del personal de la institución, esta permite hacer búsqueda de registros por nombre de persona, de dependencia,  cargo, número de teléfono, número de fax, correo electrónico.', '2017-10-11 13:48:30', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (7404, 1386, 9, 2017, 1, 0, 'Gestión iniciada, pendiente se financie para su ejecución.', '2017-10-11 13:49:50', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (7405, 1657, 9, 2017, 1, 0, '-Seguimiento de Resolución de Conflictos y Aprobación de Reglamentos Internos de Trabajo: Se han desarrollado reuniones de seguimiento con Duglas Morales a fin de corregir incidencias sobre fechas en los procesos de mediación, se esta a la espera de resultados del análisis de incidencias. -Sistema de Registro de Contratos Individuales de Trabajo: Se desplegó el sistema en producción. Se remitieron las credenciales a las personas usurarias que participaron en le proceso de desarrollo para que puedan validar el funcionamiento del mismo. Se esta a la espera de comentarios sobre la evaluación de la herramienta. -Sistema de Gestión de Asociaciones Profesionales: Se han desarrollado reuniones de seguimiento con Duglas Morales a fin de corregir incidencias en el despliegue del proyecto, se han detectado diferentes causas y se esta a la espera de implementar mejoras que corrijan las incidencias. -Sistema de Procesos Administrativos (Compras - Bodega - Activo Fijo): Se ha apoyado a las tres unidades (Compras, activo fijo y bodega), en el registro y/o migración histórica de información 2017 a fin de iniciar con el proceso de puesta en producción en octubre de 2017. Activo Fijo: Se creo un script para migrar los bienes al nuevo sistema. Bodega: Se apoyó en homogeneizar los productos, específicos y solicitantes de bodega. Compras: Se ha apoyado en el registro de requisiciones de compra y diversos ajustes al proceso para permitir en ingreso histórico de información. -Sistema Nacional de Inspecciones de Trabajo (versión nueva): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Actualización en base de datos en las tabla Infracciones. Elaboración de informe de la carga laboral de inspección de el departamento de Industria y Comercio. -Sistema Nacional de Inspecciones de Trabajo (versión antigua): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios.\nSistema de Intermediación de Empleo (Renacemepleo): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sistema Nacional de Empleo: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Elaborar Reporte de Vinculación Online Julio 2017.  -Sistema Nacional de Notificaciones de Accidentes: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos. -Se ha brindado atención a los sistemas de Bodega, Transporte y Vales de combustible, en este último se debió hacer ajustes a nivel de base de datos para migrar la la fuente de fondos de donde proceden los vales y vehículos.', '2017-10-11 13:54:37', 868, '2017-10-11 14:38:17', 868);
