INSERT INTO `pat_logro` VALUES (8068, 1657, 10, 2017, 1, 0, '-Se han creado 10 usuarios con roles de \"Solicitante\" o \"Aprobador de solicitudes\" en el Sistema de Trasporte de las direcciones de: Trabajo, previsión y administrativa. Se continuo brindando mantenimiento a todos los sistemas administrativos según solicitudes. -Sistema Informático para el Seguimiento de Resolución de Conflictos y Aprobación de Reglamentos Internos de Trabajo: Se esta trabajando en conjunto a un estudiante en servicio social, quien ha detectado y superado diversas inconsistencias en un equipo local. Se continuara trabajando en revisar inconsistencias en el servidor virtual de producción. -Sistema de Registro de Contratos Individuales de Trabajo: Se esta a la espera de coordinar la ejecución de pruebas junto a las personas usuarias en el servidor de producción, esta coordinación se ejecutara a nivel de las jefaturas de: UDT y Sub Dirección de Trabajo. -Sistema de Gestión de Asociaciones Profesionales: Se esta a la espera de coordinar la ejecución de pruebas junto a las personas usuarias en el servidor de producción, esta coordinación se ejecutara a nivel de las jefaturas de: UDT y Sub Dirección de Trabajo. -Sistema de Procesos Administrativos (Compras - Bodega - Activo Fijo): Se continua trabajando en forma conjunta al equipo de desarrollo para superar incidencias en el periodo de implementación de los tres sistemas. Se ha propuesto por parte de la dirección administrativa, iniciar el producción el 1 de noviembre de 2017. -Sistema Nacional de Inspecciones de Trabajo (versión nueva): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Apoyo en elaboración de presentación de la Legislacion Laboral. Informe de actividades realizadas y pendientes de realizar en SNIT. Capacitación a personal informático de las Oficinas Regionales. Capacitación a Supervisor Depto. Agropecuario SS. -Sistema Nacional de Inspecciones de Trabajo (versión antigua): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sistema de Intermediación de Empleo (Renacemepleo): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Soporte permanente a los usuarios del sistema. -Sistema Nacional de Empleo: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Entrega al Dept. Nacional de Empleo el Reporte de Vinculación Online (Julio 2017). Elaboración de Informe de PNE como respuesta OIR (Septiembre / Octubre 2017).  -Sistema Nacional de Notificaciones de Accidentes: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-11-08 14:32:28', 868, '2017-11-08 15:17:35', 868);
