INSERT INTO `pat_logro` VALUES (8874, 1656, 11, 2017, 1, 0, '-Intranet: Soporte permanente a\npersonas usuarias. Realización de\nrespaldo de carpeta del sistema y de\nla base de datos. -Directorio MTPS: Se verificó la actualización  de los registros.', '2017-12-12 09:37:09', 868, NULL, NULL);
INSERT INTO `pat_logro` VALUES (8875, 1657, 11, 2017, 1, 0, '-Sistema Informático para el Seguimiento de Resolución de Conflictos y Aprobación de Reglamentos Internos de Trabajo: Sistema Informático para el Seguimiento de Resolución de Conflictos y Aprobación de Reglamentos Internos de Trabajo. -Sistema de Registro de Contratos Individuales de Trabajo: Sistema de Registro de Contratos Individuales de Trabajo.\n-Sistema de Gestión de Asociaciones Profesionales: Se ha continuado trabajando con Douglas Morales en la depuración de fallas y generación de nuevas historias de usuario para corregir incidencias en el Sistema. -Sistema de Procesos Administrativos (Compras - Bodega - Activo Fijo): Se ha depurado la lista de pedidos para realizar la migración del SIB al SICBAF, se hizo ajustes en personas solicitantes. Se modificaron reportes de Activo Fijo. Se creó una alternativa para ingresar la compra de convenio de ANDA sin pasar por todo el tramite de compra ordinario. -Sistema Nacional de Inspecciones de Trabajo (versión nueva): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Configuración de entorno de desarrollo del sistema. Elaboración de manual de usuario para el proceso Consultar Actas-Autos-Informes. -Sistema Nacional de Inspecciones de Trabajo (versión antigua): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sistema de Intermediación de Empleo (Renacemepleo): Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Mantenimiento y Soporte permanente a los usuarios del sistema. Apoyo en la entrega de insumos de web service para la app de empleo para ti.\n-Portal Nacional de Empleo: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Entrega a la oficina de empleo y Estadistica reporte de Vinculación Online mes de septiembre. -Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-12-12 09:37:35', 868, '2017-12-12 10:32:08', 868);
