INSERT INTO `pat_logro` VALUES (9561, 1657, 12, 2017, 1, 0, '-Sistema Nacional de Inspecciones de Trabajo: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sistema de Intermediación de Empleo (Renacemepleo): Se realizó Respaldo de la carpeta de sistema y base de datos. Soporte permanente a los usuarios. Informe de actualización de interfaz de los Sistemas de Empleo. Creación de base de pruebas para la realización de web services para aplicativo móvil de empleo para ti. -Sistema Nacional de Empleo: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Informe de actualización de interfaz de los Sistemas de Empleo. -Sistema Informático para el Seguimiento de Resolución de Conflictos y Aprobación de Reglamentos Internos de Trabajo: Se revisaron aspectos generales del servidor siendo que el estudiante en servicio social que apoya esta actividad, se reasigno, por instrucciones de la jefatura, a trabajar en el desarrollo de la APP Empleo Para Ti. Se continuara trabajando en la implementación durante enero de 2018. -Sistema de Registro de Contratos Individuales de Trabajo: Se revisó el flujo de proceso en un ambiente de pruebas junto con el equipo de personas usuarias de la sección de contratos individuales de trabajo. Las personas empleadas de la sección de contratos individuales se comprometieron a revisar el sistema y validar su funcionamiento durante el primer mes del 2018. -Sistema de Gestión de Asociaciones Profesionales: Se sostuvo reuniones con la Directora General de Trabajo y se realizaron ajustes al desarrollo previo. Se mejoraron procesos de consulta e ingreso de datos. Se levanto un guión de funcionalidad a revisar y estas fueron corregidas en un 25%. Se continuara revisando el proyecto durante el primer trimestre de 2018. -Sistema de Procesos Administrativos (Compras - Bodega - Activo Fijo): Se trabajo en ajustes y funciones adicionales del proceso de bodega que no habían sido solicitadas en la etapa de análisis. Se acordó con la Directora Administrativa, Subdirector Administrativo y jefaturas de Bodega, Compras y Activo Fijo que se iniciaría con el proceso en paralelo al iniciar el año 2018.  -Sitio Web\nInstitucional: Soporte permanente a\npersonas usuarias. Realización de\nrespaldo de carpeta del sistema y de\nla base de datos.', '2018-01-09 14:21:47', 868, '2018-01-09 14:44:44', 868);
